import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../styles.css';

const GoOut = () => {
  const navigate = useNavigate();

  const [genre, setGenre] = useState('');
  const [location, setLocation] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [loading, setLoading] = useState(false);  // New state for loading
  const [error, setError] = useState(null);       // New state for errors

  const handleSearch = () => {
    setLoading(true);
    setError(null);

    fetch('http://127.0.0.1:5000/scrape', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        genre,
        location,
        startDate,
        endDate,
      }),
    })
    .then(response => {
      setLoading(false);  // Set loading to false once the response is received
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      return response.json();
    })
    .then(data => {
      console.log(data);
      navigate('/go-out-results', { state: { results: data } });
    })
    .catch((error) => {
      console.error('Error:', error);
    });
  };

  return (
    <div className="go-out-container">
      <Link to="/" className="home-button">Home</Link>
      <div className="venture-box">
        <h1>Venture Out!</h1>
        <div className="dropdown-container">
          <div>
            <label htmlFor="genre">Genre</label>
            <input list="genres" id="genre" name="genre" placeholder="Select or type" value={genre} onChange={(e) => setGenre(e.target.value)}/>
            <datalist id="genres">
              <option value="Rock" />
              <option value="Jazz" />
              <option value="Pop" />
              <option value="Electronic" />
              <option value="Hip Hop" />
            </datalist>
          </div>
          <div>
            <label htmlFor="range">Location</label>
            <input list="locations" id="location" name="location" placeholder="Select or type" value={location} onChange={(e) => setLocation(e.target.value)}/>
          </div>
          <div>
            <label htmlFor="price">Start Date</label>
            <input list="startDates" id="startDate" name="startDates" placeholder="YYYY-MM-DD" value={startDate} onChange={(e) => setStartDate(e.target.value)} />
          </div>
          <div>
            <label htmlFor="time">End Date</label>
            <input list="endDates" id="endDate" name="endDate" placeholder="YYYY-MM-DD" value={endDate} onChange={(e) => setEndDate(e.target.value)}/>
          </div>
        </div>
        <button className="search-button" onClick={handleSearch}>Search!</button>
      </div>
    </div>
  );
};

export default GoOut;
